import React from 'react';
// import footer from './footer.scss';

const Footer = () => {
    return (
        <footer className="footer">
            <div className="wrapper">
                <a href="#" className="logo">netflixroulette</a>
            </div>
        </footer>
    )
}

export default Footer;
